INSERT INTO `item_content` VALUES ('22', '60', '<h3>Dear Weddingguest,\r\n						\r\n						</h3>We are getting married on june 24th, 2011. Join us in our celebration! On this website you can find all the information around that day: time and place of the ceremony and party, directions, some tips according accomadation and a wishlist plus a donation formular.\r\n						\r\n						<br>Let us know if you\'ll be there!', null, '2011-04-02 21:45:44');
INSERT INTO `item_content` VALUES ('23', '61', null, null, '0000-00-00 00:00:00');
INSERT INTO `item_content` VALUES ('24', '60', '<h3>Liebe Hochzeitsgste,\r\n						\r\n						</h3>Am 24. Juni 2011 wird geheiratet und das muss gefeiert werden! Auf dieser Webseite findet Ihr Informationen ber Zeit und Ort von Standesamt und Fest, Anfahrts Beschreibungen, Tips fr Unterknfte und eine Liste met Geschenkwnschen und die Mglichkeit um hierfr zu spenden.\r\n						\r\n						<br>Lasst uns wissen , ob Ihr kommt!', null, '2011-04-02 21:45:52');
INSERT INTO `item_content` VALUES ('25', '62', '<h3>Waar?</h3>\r\n		\r\n		<br>This, of course, is not the real copy for this advertisement. The real \r\n						words will be written once you have approved the headline. Rest assured,\r\n						 the words will expand the concept. With clarity. Conviction. And even a\r\n						 little wit. Because in todays competitive marketing environment, the \r\n						body copy of your advertisment must lead the reader through a series of \r\n						disarmingly simple thoughts. All your supporting arguments must be \r\n						communicated with simplicity and charm. And in such a way that the \r\n						reader will read on. (After all, thats a readers job: to read, isnt \r\n						it?) And by the time your readers have reached this point in the \r\n						finished copy, you will have convinced them that you not only respect \r\n						their intelligence, but you also understand their needs as consumers. As\r\n						 a result of which, your advertisment will repay your efforts. Take your\r\n						 sales; simply put, they will rise. Likewise your credibility. Theres \r\n						every chance your competitors will wish theyd placed this \r\n						advertisement, not you. While your customers will have probably \r\n						forgotten that your competitors even exist.\r\n		<br>\r\n<iframe width=\"425\" height=\"350\" frameborder=\"0\" scrolling=\"no\" marginheight=\"0\" marginwidth=\"0\" src=\"http://maps.google.com/maps?f=q&amp;source=s_q&amp;hl=en&amp;geocode=&amp;q=amsterda,+distelweg&amp;aq=&amp;sll=52.103968,5.088782&amp;sspn=0.07191,0.154324&amp;ie=UTF8&amp;hq=&amp;hnear=Distelweg,+Amsterdam,+Noord-Holland,+The+Netherlands&amp;ll=52.393359,4.903756&amp;spn=0.001157,0.002411&amp;z=14&amp;output=embed\"></iframe><br /><small><a href=\"http://maps.google.com/maps?f=q&amp;source=embed&amp;hl=en&amp;geocode=&amp;q=amsterda,+distelweg&amp;aq=&amp;sll=52.103968,5.088782&amp;sspn=0.07191,0.154324&amp;ie=UTF8&amp;hq=&amp;hnear=Distelweg,+Amsterdam,+Noord-Holland,+The+Netherlands&amp;ll=52.393359,4.903756&amp;spn=0.001157,0.002411&amp;z=14\" style=\"color:#0000FF;text-align:left\">View Larger Map</a></small>', null, '2011-03-27 18:28:26');
INSERT INTO `item_content` VALUES ('26', '66', '<h3>This is dummy copy. </h3>You\'re not really supposed to read dummy copy, it is\r\n		 just a place holder for people who need some type to visualize what the\r\n		 actual copy might look like if it were real content. If you want to \r\n		read, I might suggest a good book, perhaps Hemingway or Melville. That\'s\r\n		 why they call it dummy copy.', null, '2011-03-27 22:54:19');
INSERT INTO `item_content` VALUES ('27', '76', null, null, '0000-00-00 00:00:00');
INSERT INTO `item_content` VALUES ('28', '60', '<h3>Lieve Gast,\r\n								\r\n								</h3>Op 24 Juni 2011 gaan wij trouwen, en dat moet worden gevierd! Op deze website vind je informatie over de tijd en plaats van ons trouwen en het feest, routebeschrijvingen, tips voor accomodatie en een lijstje met onze dromen en verlangens en de mogelijkheid om hiervoor te \"doneren\".\r\n				<br>Laat ons even weten of je komt!', null, '2011-04-02 21:45:59');
INSERT INTO `item_content` VALUES ('30', '78', '<h3><span class=\"en\">Hop on Hop off canal cruise</span>\r\n						<span class=\"de\">   Hop on Hop off Canal Bus</span>\r\n						<span class=\"nl\">  Hop on, Hop off rondvaart</span></h3>\r\n										\r\n										<br>In between the ceremony in the morning and the party at night, there\r\n										is lots of time to spend. Canal Bus is a good way of getting\r\n										around the canals and it takes you past many historic buildings and\r\n										all Amsterdam?s sights and museums. The boats offer a frequent\r\n										and regular service with 4 routes and 20 stops, including 6 transfer\r\n										points. Your 24-hour ticket allows you to hop on and off as often\r\n										as you like. Buy the ticket online with 10% discount.<br><a href=\"http://www.canal.nl/bus/en/\">http://www.canal.nl/bus/en/</a><br>', null, '2011-03-30 23:37:58');
INSERT INTO `item_content` VALUES ('31', '78', 'Zwischen dem Standesamt  am Morgen und der Party am Abend gibt es\r\n						genug Zeit um die Stadt ein bisschien kennen zu lernen.\r\n						Canal Bus bietet Euch die ideale Mglichkeit von den Grachten aus alle\r\n						berhmten Sehenswrdigkeiten und Museen von Amsterdam\r\n						zu entdecken. Die Boote fahren in regelm?igen Abstnden auf 4\r\n						verschiedenen Routen mit 20 Anlegestellen, wovon Ihnen 6 die\r\n						Mglichkeit zum umsteigen bieten. Mit dem 24-Stunden Ticket knnen Sie\r\n						nach Belieben um- und aussteigen.\r\n						Beim online Kauf gibt es 10% Rabatt.\r\n						<br><a href=\"http://www.canal.nl/bus/de/\">http://www.canal.nl/bus/de/</a>', null, '2011-03-30 23:20:43');
INSERT INTO `item_content` VALUES ('32', '78', 'Tussen de ceremonie s\'ochtens en het feest s\'avonds is er genoeg tijd\r\n								om de stadt een beetje te verkennen. De Canal Bus brengt je\r\n								door bekende grachten naar alle bezienswaardigheden en de beroemdste\r\n								musea. De boten varen volgens een vast tijdschema vier\r\n								verschillende routes met 20 haltes waarvan zes overstappunten. Met het\r\n								24-uurs ticket stap je in en uit zo vaak je wilt.\r\n								Koop het ticket online met 10% korting.\r\n								<br><a href=\"http://www.canal.nl/bus/nl/\">http://www.canal.nl/bus/nl/</a>', null, '2011-03-30 23:20:49');
INSERT INTO `item_content` VALUES ('33', '79', '<strong class=\"directions-by-car\">To the council offices from the Ring Amsterdam</strong>\r\n		<ol>\r\n		    <li>Departure in southwest on the A10 to exit Diemen\r\n		    <span class=\"dist\">400m</span></li>\r\n		    <li>Take exit and merge onto Diemen Middenweg/s113\r\n		    <span class=\"dist\"> 2,6 km</span></li>\r\n		    <li>Turn right at Oranje Vrijstaatkade/Transvaalstraat. Continue on the Oranje Vrijstaatkade\r\n		    <span class=\"dist\">210 m</span></li>\r\n		    <li>Turn left at the Oranje-Vrijstaatplein, destination will be on your right\r\n		    <span class=\"dist\">28 m</span></li>\r\n		</ol>\r\n		<address>	\r\n		Stadsdeelkantoor Oost/Watergraafsmeer\r\n		Oranje-Vrijstaatplein 2\r\n		</address>\r\n		<strong class=\"directions-pt\">To the council offices by Public Transport from the Central Station</strong>\r\n		<ol>\r\n		    <li>Take tram 9 direction Diemen-Zuid</li>\r\n		    <li>Get off at Pretorius Street</li>\r\n		    <li>Walk 1min. along the Linneausstraat. Turn left behind the HEMA in Linneauskade.</li>\r\n		    <li>Take the little bridge on your left towards the council offices</li>\r\n		</ol>\r\n		<address>	\r\n		Stadsdeelkantoor Oost/Watergraafsmeer\r\n		Oranje-Vrijstaatplein 2\r\n		</address>  \r\n', null, '2011-04-02 21:55:23');
