INSERT INTO `item_content` VALUES ('35', '79', '<strong class=\"directions-by-car\">Naar het Stadsdeelkantoor\r\n		vanaf de Ringweg Amsterdam</strong>\r\n		<ol>\r\n		    <li>Vertrek in zuidwestelijke richting op de A10 naar Afslag Diemen\r\n		    <span class=\"dist\">400m</span></li>\r\n		    <li>Neem de afslag Diemen en voeg in op de Middenweg/s113\r\n		    <span class=\"dist\"> 2,6 km</span></li>\r\n		    <li>Sla rechtsaf bij Oranje Vrijstaatkade/Transvaalstraat. Ga verder op de Oranje Vrijstaatkade\r\n		    <span class=\"dist\">210 m</span></li>\r\n		    <li>Sla linksaf bij Oranje-Vrijstaatplein U vindt uw bestemming rechts\r\n		    <span class=\"dist\">28 m</span></li>\r\n		</ol>\r\n		<address>	\r\n		Stadsdeelkantoor Oost/Watergraafsmeer\r\n		Oranje-Vrijstaatplein 2\r\n		</address>\r\n		<strong class=\"directions-pt\">Naar het Stadsdeelkantoor vanaf Centraal Station</strong>\r\n		<ol>\r\n		    <li>Neem tram 9 richting Diemen-Zuid</li>\r\n		    <li>Stap uit op Pretoriusstraat</li>\r\n		    <li>Loop 1min. langs de Linneausstraat. Sla achter de HEMA links af in de Linneauskade.</li>\r\n		    <li>Klein bruggetje links oversteken naar het Stadsdeelkantoor</li>\r\n		</ol>\r\n		<address>	\r\n		Stadsdeelkantoor Oost/Watergraafsmeer\r\n		Oranje-Vrijstaatplein 2\r\n		</address>', null, '2011-04-02 21:48:42');
